//import logo from './logo.svg';
import johannes from './image/johannes-plenio.jpg'
import Navbar from './components/navbar';
import './stylesheet/App.css';
import VerticalTimeline from './components/timeline.js'

function App() {
  return (
    <div className='mainDiv'>
      <Navbar/>
      <div className='container' class="container mt-4">
        <div class="container">
        <img src={johannes} alt="Landscape with a boat" className='johannes' ></img>
        </div>
        <p><i>Credit Johaness Pieno, retrieved from: https://unsplash.com/photos/DKix6Un55mw</i></p>
      </div>
      <div>
        <VerticalTimeline/>
      </div>

    </div>
    
  );
}

export default App;
